            project_id: 10174980,
            title: 'Fixes #1563 - Implements Quad Med Hoof tactic/attack',
            description:
                '- [x] By opening this merge request, you agree to release your code and all other changes under the GPL 3 license and to abide by the terms set by this license.\n- [ ] **Migrations have been added if applicable**\n- [ ] Significant changes of this merge request have been added to the changelog.\n\n---\n\nI\'m not entirely sure about `HOOF_ATTACK_ANGLE` and `HOOF_ATTACK_RANGE` values and how they relate to `range` and `angle` values in the [`quadmedhoof/basic.ron`](https://gitlab.com/veloren/dev/veloren/-/blob/master/assets/common/abilities/custom/quadmedhoof/basic.ron) file.\n\nI imagine one is for calculation of "did attack hit" (the .ron values) and the other is for AI to decide if we want to get closer or attack (the attack.rs).\n\nI was thinking if the `HOOF_ATTACK_RANGE` should be `0.0` as it would kinda make sense for llama to try to get close as possible?',
